import React from 'react';
import './App.css';
import { BrowserRouter as Router, useNavigate } from 'react-router-dom';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Aplikacija za lov</h1>
                <div className="Menu">
                    <Button text="EVIDENCIJA LOVACA" />
                    <Button text="RASPORED AKTIVNOSTI I LOVA" />
                    <Button text="EVIDENCIJA PRISUTNOSTI NA LOVNI DAN" />
                    <Button text="UNOS DIVLJAČI" />
                    <Button text="UNOS ODSTRIJELENE DIVLJAČI" />
                    <NavigationButton to="/popis-bodova" label="Bodovi" />                </div>
            </header>
        </div>
    );
}
function Button({ text }) {
    return (
        <div className="Button">
            {text}
        </div>
    );
}

export default App;
